import React from "react";
import Navbar from "../../components/Navbar";
import Footer from "../../components/Footer/Footer";

const GridLayoutSub = () => {
    return( 
    <div className="GridLayoutSub">
        <Navbar/>
    <div className="GridLayoutSub-section">
        <div className="GridLayoutSub-section-content">
         
        </div>
    </div>

    <Footer/>
    </div>
    );
}

export default GridLayoutSub;
